script: |
  super -f text -I q9144.spq | sort > q9144.out

inputs:
  - name: q9144.spq
    data: |
      SELECT - cor0.col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE col0 * - col0 <> ( col0 ) OR NOT col0 * + col2 NOT IN ( - col1 );
  - name: tab2

outputs:
  - name: q9144.out
    data: |
      -7
      -78
      -79
